def getProtein(rnaSequence):
    codonDict = {}
    result = ''
    codonsFile = open("codon table.txt","r")
    for line in codonsFile:
        line = line.strip("\n")
        codonDict.update({line.split(" ")[0]:line.split(" ")[1]})
    
    for i in range(0,len(rnaSequence)-1,3):
        temp = codonDict[rnaSequence[i:i+3]]
        if(temp):
            if(temp != 'Stop'):
                result = result + temp
    print(result)

rna = ""
getProtein(rna)